import { useQuery } from "@apollo/client";
import { gql } from "apollo-boost";
import React from "react";

function App() {
  const { data, loading } = useQuery(gql`
    {
      hello
    }
  `);

  if (loading) return <div>loading...</div>;

  return <div>{JSON.stringify(data)}</div>;
}

export default App;
